import '../App.css'


interface HeaderProps {
    finalPrice:number;
    productTypeValue?: string;
    onProductTypeChange?: (newType: string) => void;
};



const Header: FC<HeaderProps> = ({finalPrice, productTypeValue, onProductTypeChange}) => {


    return (
        <div>
            <section className="header-top">
                <div className="container header-top__container">
                <div className="header-top__left">
                <div className="header-top__block">
                <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M10 10.8335C11.3807 10.8335 12.5 9.71421 12.5 8.3335C12.5 6.95278 11.3807 5.8335 10 5.8335C8.61929 5.8335 7.5 6.95278 7.5 8.3335C7.5 9.71421 8.61929 10.8335 10 10.8335Z" stroke="#3F4E65" strokeWidth="1.3" strokeLinecap="round" strokeLinejoin="round"/><path d="M9.99967 1.66675C8.23156 1.66675 6.53587 2.36913 5.28563 3.61937C4.03539 4.86961 3.33301 6.5653 3.33301 8.33342C3.33301 9.91008 3.66801 10.9417 4.58301 12.0834L9.99967 18.3334L15.4163 12.0834C16.3313 10.9417 16.6663 9.91008 16.6663 8.33342C16.6663 6.5653 15.964 4.86961 14.7137 3.61937C13.4635 2.36913 11.7678 1.66675 9.99967 1.66675V1.66675Z" stroke="#3F4E65" strokeWidth="1.3" strokeLinecap="round" strokeLinejoin="round"/></svg>

                    <div className="header-top__body"></div>
                </div>
                <div className="header-top__block">
                    <div className="header-top__body"></div>
                </div>
                </div>
                <div className="header-top__right"></div>
                </div>
            </section>


            <div className="header">MAIN HEADER
                <button>Корзина: {finalPrice} ₸</button>
            </div>

        </div>
    )
}

export default Header;
